import React from 'react';
import Image from "../image";
import './style.css';


const pugImage = "https://previews.123rf.com/images/tanjaesser/tanjaesser1706/tanjaesser170600001/79608436-pug-steers-the-car.jpg";
// Stateless function
const Car = ({model, make, trim, colors, year, fuelType, key}) => {
    return(
        <div className="card-container">
            <Image src={pugImage} />
            <div className="card-description">
                <p> <span>Model:</span>  {model} </p>
                <p> <span>Make:</span>  {make} </p>
                <p> <span></span>  {trim} </p>
                <p> <span></span> Colors: {colors} </p>
                <p> <span></span> Year: {year} </p>
                <p> <span></span> Fuel Type: {fuelType} </p>
            </div>
        </div>
    )
}
export default Car;
